        Solution: Its just being shy. Give it some encouragement by knocking lightly on the hull, or jostling the [color=darkorange][bolditalic]Aether Coil Modulator[/bolditalic][/color]. If no response, consult the  [color=blue][bold]Technical Support AI[/bold][/color] (usually known as "Door Stuck").


        [bolditalic]Problem: 

        The shuttle is stuck halfway through the docking process.[/bolditalic]  

        Solution: This is an unfortunate but expected outcome. Reboot the dock, reattempt the process, and pray. Alternatively, try "tugging" the shuttle out, but be prepared for the consequences.


        [bolditalic]Problem: 

        The dock has *disengaged itself* mid-operation.[/bolditalic]  

        Solution: This is a feature of the  [color=darkblue][bold]NanoTrasen Smart Dock Mk VII[/bold][/color], called the  [color=darkorange][bolditalic]Premature Release Safety Protocol[/bolditalic][/color]. It's designed to keep you on your toes. Simply re-dock and hope it doesnt happen again (spoiler: it will).


        [head=2][color=darkgrey][bold]Emergency Procedures[/bold][/color][/head]


        [bullet] [bold]Step 1:[/bold] In the event of catastrophic failure, remain calm and activate the [color=darkorange][bolditalic]Emergency Detachment Lever[/bolditalic][/color]. This will forcibly eject your shuttlealong with any unresolved docking issuesinto deep space. Problem solved!

        [bullet] [bold]Step 2:[/bold] If the shuttle begins spinning uncontrollably, use the [color=darkorange][bolditalic]Stabilizer Override Control[/bolditalic][/color]. If that fails, use the age-old technique: scream and brace for impact.

        [bullet] [bold]Step 3:[/bold] In case of a complete docking collapse (which occurs in *only* 23% of cases), fill out [color=darkblue][italic]Form D-7: Docking Disaster Report[/italic][/color]. Your report will be reviewed within 3-5 business cycles, after which it will be safely ignored.


        [head=2][color=darkgrey][bold]Common Features[/bold][/color][/head]


        The  [color=darkblue][bolditalic]NanoTrasen Smart Dock Mk VII[/bolditalic][/color] comes with a wide variety of [bold]exciting[/bold] and [bold]untested[/bold] features:


        [bullet] [bold]Auto-Align Mode:[/bold] When this works, the dock aligns perfectly with your shuttle. When it doesn't, it aligns with... something else.

        [bullet] [bold]Graviton Locking Arms:[/bold] These arms are designed to gently secure your shuttleunless they randomly decide to engage [bold]Crush Mode[/bold], in which case, hold on tight.

        [bullet] [bold]Friendly Docking Lights:[/bold] These lights blink and flash to give the illusion that the dock is working, even when its not.


        [head=2][color=darkgrey][bold]FAQ: Frequently Avoided Questions[/bold][/color][/head]


        [bolditalic]Q: What do I do if the docks lights go out suddenly?[/bolditalic]  

        A: Nothing. Just accept the darkness. The dock has either entered [color=darkorange][bolditalic]Sleep Mode[/bolditalic][/color], or something unspeakable is about to happen.


        [bolditalic]Q: Why does the dock occasionally whisper my name?[/bolditalic]  

        A: The dock is semi-sentient and enjoys toying with your mental state. We suggest playing along until it decides youre no longer amusing.


        [bolditalic]Q: How do I know if the docking process is complete?[/bolditalic]  

        A: You'll know it's done when your shuttle stops shaking violently and the alarms stop blaring. Or when you black outwhichever comes first.


        [head=3][color=darkblue][bold]Thank You for Choosing NanoTrasen[/bold][/color][/head]

        At [color=darkblue][bolditalic]NanoTrasen[/bolditalic][/color], we believe that every dock is an opportunity for improvement. Mostly yours. And remember, your [color=darkblue][italic]Corporate Loyalty Bonus[/italic][/color] is tied directly to how many of these manuals you distribute.



